DATA[THIS_TYPE]["DISPLAY_CHART"] = function() {
	let type = "FIGHTER"
	if (!document.getElementById(type + "_CHART")) {
		let PartsImageContainer = document.getElementById("PartsImageContainer")
		var PartImageSection = document.createElement("div")
		PartImageSection.id = "CHART" + "PartImages"
		var image = document.createElement("img")
		image.id = type + "_CHART"
		image.src = DATA[type]["CHART"]
		image.style.maxWidth = "132%"
		image.style.maxHeight = "132%"
		image.style.marginLeft = "-20%"
		image.style.top = "-3%"
		PartImageSection.appendChild(image)
		PartsImageContainer.appendChild(PartImageSection)
	}
}

DATA[THIS_TYPE]["LAYERING"] = function(PARTS) {
	var wing = ""
	var subwing = ""

	for (let i = 0; i < PARTS.length; i++) { 
		if (PARTS[i].includes("_WING")) {
			wing = PARTS[i]
		}
	}	
	for (let i = 0; i < PARTS.length; i++) { 
		if (PARTS[i].includes("_SUBWING")) {
			subwing = PARTS[i]
		}
	}
	if (subwing == "_SUBWINGS_A" && wing == "_WINGS_K") {
		subwing = "_SUBWINGS_B1"
	} else if (subwing == "_SUBWINGS_E" && wing == "_WINGS_K") {
		subwing = "_SUBWINGS_A1"
	}	
	
	var LAYERS = []
	for (let i = 0; i < PARTS.length; i++) { 
		if (PARTS[i].includes("_SUBWING")) {
			LAYERS.push("FIGHTER" + wing + subwing + "_LEFT")
			LAYERS.push("FIGHTER" + wing + subwing + "_RIGHT")
		} else {
			LAYERS.push("FIGHTER" + PARTS[i] + "_LEFT")	
			LAYERS.push("FIGHTER" + PARTS[i] + "_RIGHT")	
		}
	}
	return LAYERS
}


